about:
Kristen is a Therapeutic Yoga Teacher in the Pittsburgh area. In addition to being 500hr Yoga Alliance Registered, she is Relax and Renew Restorative Yoga Certified.   Kristen is in the process of becoming a ceritified Yoga Therapist with IAYT from the Kripalu School of Integrative Yoga Therapy and leads yoga and meditation classes online.
